import React from 'react';
import './Home.css';
import Nav from '../Nav/Nav';
import Footer from '../Footer/Footer'

const Home = () =>{
    return(
        <div className="right">
            <Nav/>
            <div className="name">
                <h1>Akhil</h1>
                <h1>Preet Singh</h1>
            </div>
            <Footer/>
        </div>
    )
}

export default Home;
